        <path fillRule="evenodd" d="M18 10a8 8 0 11-16 0 8 8 0 0116 0zm-7-4a1 1 0 11-2 0 1 1 0 012 0zM9 9a1 1 0 000 2v3a1 1 0 001 1h1a1 1 0 100-2v-3a1 1 0 00-1-1H9z" clipRule="evenodd" />
      </svg>
    </div>
    <div class="ml-3 flex-1 md:flex md:justify-between">
      <p class="text-sm leading-5 text-blue-700">
        This post is the first of several articles intended as personal growth
        exercises, rather than sharing with the community. As I learn new
        things, I want to write about them to further cement my understanding
        and hold myself accountable
      </p>
    </div>
