    </div>
    <p>{`Named types can be assigned names when created. These include `}<strong parentName="p">{`classes`}</strong>{`, `}<strong parentName="p">{`structures`}</strong>{`, `}<strong parentName="p">{`enumerations`}</strong>{`, and `}<strong parentName="p">{`protocols`}</strong>{`. Instances of user-defined named types carry the name of the given type. For example, a class named `}<inlineCode parentName="p">{`MyClass`}</inlineCode>{` will have the type `}<inlineCode parentName="p">{`MyClass`}</inlineCode>{`. Swift also includes many standard named types for arrays, dictionaries and optional values.`}</p>
    <p>{`Compound types are types without a specific name. A compound type may contain other named and compound types. For example, the compound tuple type `}<inlineCode parentName="p">{`(Int, (Int, Int))`}</inlineCode>{` contains two inner types. The first is the named `}<inlineCode parentName="p">{`Int`}</inlineCode>{` type, the second is a compount type of `}<inlineCode parentName="p">{`(Int, Int)`}</inlineCode>{`.`}</p>
    <p>{`Properties are either stored, or computed. A stored property has a fixed value. On the other hand, a computed property is calculated every time it is are accessed. There are also simple observers on properties that listen to changes via callbacks. These observers are `}<inlineCode parentName="p">{`willSet`}</inlineCode>{` and `}<inlineCode parentName="p">{`didSet`}</inlineCode>{`.`}</p>
    <p>{`This was very difficult for me to wrap my head around in my early Swift learning days.`}</p>
    <h3>{`Value types vs Reference types`}</h3>
    <p>{`When a piece of data is saved to disk, it is saved in a container. Imagine each container having a label on the outside. Value types refer to the `}<em parentName="p">{`actual data`}</em>{` inside the container. Reference types refer to the label, or `}<em parentName="p">{`memory address`}</em>{` on the container.`}</p>
